import React from 'react';
import logo from './logo.svg';
import axios from 'axios';
import './App.css';

class App extends React.Component {
  componentDidMount() {
    axios.get('localhost:9393/test')
    .then(function (response) {
      // handle success
      console.log(response);
    });
  }
  render() {
    return (
      <div className="App">

      </div>
    )
  }
}

export default App;
